■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">シマノ バンタム SHIMANO Bantam / バスロッド BASS<br /><br /><br />バスフィッシングの楽しみを、すべてのアングラーに。「バンタム」がめざしているのは、バスフィッシングの本質を捉え、総合力に長けたバスタックルの創造。ベイトキャスティングロッドは、「バーサタイル」、「ジグ＆ワーム」「ハードベイト＆ビッグベイト」の王道ともいえる3つのシリーズで構成された計9アイテム。各アイテムが体現する高い汎用性が、幅広いシーンでアングラーを強力にサポートします。スピニングの5アイテムでも、同じく汎用性と適応力を備えながら、それぞれに合った最適な調子を追求。ベイト、スピニングのいずれもブランクスの肉厚を落としすぎず、ロッドを曲げこんだ状態でも安定して粘り続ける強靭な設計となっています。活躍の場はフィネスからパワーゲーム、日本に留まらず本場アメリカまでを見据えるなど、フィールドを限定しない世界水準の仕上がりです。<br /><br />■ベイトモデル<br /><br />■168ML-G <br />芯のある粘りを備えたグラスコンポジットロッド<br /><br />ハードベイトを投げて、巻いて、獲るためのグラスコンポジットロッド。シャローからミドルダイバーによるカバークランキングはじめ、小～中型サイズのバイブレーションやトップウォータープラグなどに適応。グラスならではの粘りはハードベイトの泳ぎを存分に引き出し、その振動をロッド全身でここちよく感じられます。軽い負荷ではグラスの粘りが際立ちながらも、曲げ込むほどにカーボンの強さが漲るようなブランクスに設計。サイドキャストからオーバーヘッドキャストまでブレのないキャストフィールを実現し、カバーからも強引にバスを引き寄せるパワーを発揮します。<br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
