■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">がまかつ がま鮎 ファインマスターF IV Gamakatsu Fine Master F4 <br /><br />実釣性能を極限まで追求する超実戦主義が生んだ。「使いやすさ」<br /><br />■MH<br />トップから#3にかけては超繊細設計。しかし、元竿に向けては、感度と操作性の向上をめざして前作より若干張りを出しています。また、それにより対応できる鮎のサイズも大きくすることができました。膝丈までの水量で、20cm前後までを釣るのにおすすめです。<br /><br />■H<br />前作は、自動車レース最高峰F1マシーンのように使いこなせば最強、しかし、釣り手を選ぶ竿でした。今回、高性能はそのままに、あえてマイルドにチューン。国産スポーツカーのように使い手を選ばず、能力をすべての人が体感できるオールラウンダーに仕上げました。膝丈までの水量で23cm程度までなら万能に使えます。<br /><br />■XH<br />先調子で圧倒的な操作性や感度を持ちながらも、掛かればしっかりと曲がり込み、竿が魚を浮かせてくれるように設計しました。持った感じや操作感は硬中硬クラスですが、鮎を掛けるやいなやまるで急瀬クラスのパワーを発揮します。想定シチュエーションは、腰丈までの水量で23cm程度の鮎を主に瀬で釣るイメージです。<br /><br />■XXH<br />XHタイプと同様に、ただ硬いだけの先調子ではなく、圧倒的な操作性や感度を持ちながらも、掛ければ竿が魚を浮かせてくれるような軽量繊細パワーロッドの究極ともいえる性能の持ち主です。腰丈までの水量で、25cm程度の鮎を、主に瀬で釣るのに適しています。<br /><br />■発売年：2017年<br /></font></td></tr></table><STYLE type="text/css">
