■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">ダイワ グローブライド エアエッジ DAIWA AIREDGE / バスロッド ブラックバス BASS<br /><br /><br />現場で叩き上げた本気のバーサタイル <br /> <br />前期のフラッグシップが次期の下位機種にトップダウンするのはもはや過去の話。DAIWA WORKSプロアングラーとデザイナーが共に現場で磨き上げていくロッドはもはや上位機種のみに留まらない。エアエッジは全機種のブランクに高弾性HVFカーボンを採用すると共に、X45とブレーディングX構造が高負荷時のネジレを抑制。上位機種に引けを取らないDAIWA最新テクノロジーに裏付けられたロッドの性能は様々なフィールドやコンディションに対応する懐の深さを見せ、理想のテーパーを実現。アングラーは手にした瞬間、その剛性感から導かれるコンフィデンスにより常に安定したパフォーマンスを発揮できる。オールステンレスSiCガイド、ダブルアルマイトリングにオリジナルリールシート（スピニングはFuji VSS）を搭載。スタイリッシュな外観は伊達ではなく、軽さだけにこだわったモデルでもない。ワンランク上のクオリティがエアエッジには存在する。<br /><br />■X45<br />■メガトップ（※641LB-ST・E、621ULS-ST・E、641L/MLS-T・Eのみ）<br />■高密度HVFカーボン <br />■BRAIDING X <br /><br />■641MLS・E (スピニングモデル)<br />MLパワーにしてはややソフトなティップを持ったファストテーパーのフィネスバーサタイルスピニングロッド。レングスも操作性と遠投性能を兼備した6’4”に設定し、高感度かつ繊細なティップはウィード一本一本をほぐしながらトレースしたり、ハードボトムの石を一つ一つ乗り越えながらトレースすることができる。また遠距離でもしっかり掛けられるバットパワーを有しており、カバー周りでも掛けたら一気に引き剥がすことが可能。抵抗の大きいネコリグやスモラバ、ジグヘッドをはじめ、高比重ノーシンカーや重めのシンカーを背負わせたダウンショットなどにも対応。<br /><br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
