■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">ダイワ グローブライド 16クレスト DAIWA GLOBERIDE CREST / スピニングリール<br /><br /><br />回転性能・耐久性が大幅に向上したハイパフォーマンスモデル <br /> <br />軽量＆高剛性の新型ボディ、インフィニットストッパー搭載で前作をはるかにしのぐ回転性能を実現。耐久性に優れたデジギヤII、ライントラブルを激減させるABS II・クロスラップ・ツイストバスターIIなど、トラブルなく快適に釣りを楽しむための機能も充実。もちろん淡水・海水どちらのフィールドでも使用可能。ハンドルはスムーズで滑らかな回転をもたらす高精度アルミマシンカットハンドルを搭載。初めての1台としても申し分ないスペックを備えたダイワスピニングリールのスタンダードモデル。 <br /><br />■新型ボディ＆アルミマシンカットハンドル<br />軽量で剛性に優れた新型ボディに安定した巻き上げ感をもたらす高剛性アルミマシンカットハンドルを搭載。インフィニットストッパーとの相乗効果でガタツキのないシルキーな回転を実現。<br /><br />■ABS II<br />ラインがトラブル無く放出されて、飛距離が伸びるスプール構造。大口径で巻き取り面を逆テーパーにすることで、スプール前方のラインが押し出されにくくなり、バックラッシュを始めとしたライントラブルが激減。大口径スプールは巻き取りスピードとドラグ性能の向上にも寄与。ABS IIはスプールリング形状を見直し、キャスト時の抵抗を軽減。より遠投性能が高まっている。<br /><br />■クロスラップ<br />巻き糸角度の大きい綾巻き方式を採用することで、スプール巻糸部へのラインの食い込みや糸のズレを防ぐためにクロスして巻き取る方式。特に細糸やPEラインを使用した場合にライントラブルの減少が顕著であり、同時に心地よい飛びを実現。<br /><br />■デジギヤII<br />ダイワ独自のデジタル設計技術「デジギヤ」がさらに進化。デジタル解析によって導き出された理想的な歯面を実現するために、超高精度マシンカット技術を採用し、鍛造ギヤーの数倍以上の歯面精度を実現。ドライブギヤーに特殊ラッピング加工を施し、ピニオンギヤーとドライブギヤーの最適バランスを取ることで耐久性が向上している。<br /><br />■DS4（ボディ・ローター素材）<br />ダイワ独自の技術で生み出されたリール専用ファイバー強化特殊プラスチック。<br /><br />■アルミスプール<br />■ツイストバスターII<br />■リアルインフィニットストッパー<br />■トーナメントドラグ<br /><br />■ソルト対応<br />■付属品：調整ワッシャー  <br /><br /><br />■発売年：2016年</font></td></tr></table><STYLE type="text/css">
